import React from "react";

class SchoolPanel extends React.Component {

    constructor(props) {
        super(props);
    }

    tabHeader() {
        return "<tr><td>Name</td><td>Adress</td><td>Phone number</td></tr>";
    }

    render() {
        return <div>
            {this.tabHeader()}
        </div>
    }
}
